INSERT INTO `receipe` (`r_id`, `r_name`, `ing`, `STEPS`, `imagesrc`, `res_id`, `image`) VALUES
(1, 'ROASTED TOMATO SOUP', '10 to 12 Tomatoes , White Onion , Garlic , Olive Oil , Fresh Basil\n', 'Preheat Oven to 400 Degrees Roughly dice tomatoes.\r\nSpread tomatoes out on cookie sheet , salt and pepper, olive oil.\r\nRoast for 45 minutes.\r\nSlowly cook 3/4 of a large diced onion in olive oil with 5 to 6 cloves of sliced garlic (keep the garlic big so it doesn\'t burn) , salt and pepper.\r\nWhen tomatoes are done add to a soup pot and scrape in all the onion and garlic and good bits. \r\nAdd water to just cover the tomatoes\r\nSimmer for 10 to 15 minutes When done simmering add a generous handful of fresh basil Take off heat and use a stick blender and puree.\r\nAdjust seasoning. \r\nIf you want pour the soup through mesh strainer to catch the tomato skins.', 'https://www.ambitiouskitchen.com/wp-content/uploads/2017/08/tomatosoup-4.jpg', 3, ''),
(2, 'BREAD BUTTER', 'Bread , Butter', 'Grease a 1 litre/2 pint pie dish with butter.\r\nCut the crusts off the bread.\r\nSpread butter on bread.', 'https://i.ytimg.com/vi/ElF32DPcbJw/maxresdefault.jpg', 4, ''),
(3, 'CHEESE SANDWICH', 'Cheese , Bread', 'Toast bread in a toaster until golden. \r\nPlace slices of cheese between the two pieces of toast. \r\nWrap sandwich in a paper towel, and heat in the microwave for 15 to 20 seconds, or until cheese is melted.', 'http://indianhealthyrecipes.com/wp-content/uploads/2016/09/cheese-sandwich.jpg', 4, ''),
(4, 'CHAPATI', 'Flour , Oil', 'In a large bowl, stir together the whole wheat flour, all-purpose flour and salt. \r\nUse a wooden spoon to stir in the olive oil and enough water to make a soft dough that is elastic but not sticky.\r\nHeat a skillet over medium heat until hot, and grease lightly.', 'https://static.toiimg.com/thumb/61203720.cms?imgsize=670417&width=509&height=340', 0, ''),
(5, 'MILK FRUIT SALAD', 'Banana , Custard Powder , Milk , Saffron , Grapes', 'Mix 1/2 cup milk, custard powder and saffron in a bowl.\r\nHeat 2 and 1/2 cups milk in a pan over low flame.\r\nCook until milk becomes thick or for around 8-10 minutes.\r\nTurn off the flame and transfer it to a bowl.\r\nWash banana , grapes and apple in running water and drain them.\r\nCut banana and apple into small pieces and add them along with grapes into milk.\r\nKeep in the refrigerator to cool.', 'https://i.ytimg.com/vi/Nk3Y0GZrvIA/maxresdefault.jpg', 0, ''),
(6, 'CHEESY JALAPENO CHIPS', 'Oil , Butter , Jalapeno , Cheese', 'Preheat oven to 350º. \r\nPlace a sheet of parchment paper on a metal cookie sheet.  \r\nDO NOT use a silicone/silpat sheet, waxed paper or foil (unless it’s the special non-stick foil) to bake these or they will not cook properly. \r\nUsing a tablespoon, scoop up 1 T. of cheese and make a small pile on the parchment.  \r\nPress it slightly flat.  \r\nRepeat 15 more times.\r\nPlace a slice of jalapeno on top of each pile. \r\nPop into 350º oven for about 10-12 minutes. \r\nRecommend browning them a bit more than shown in the photo for a firmer snack to serve at parties. \r\nThese are somewhat pliable if under browned.\r\nAllow them to completely cool and fully firm up before removing from the pan for best results.', 'https://images.halaal.recipes/17-11-17/2017-11-17-16-22-27-ChsBr.jpg', 0, ''),
(7, 'OVEN BAKED FRIED FRIES', '3 russet potatoes (about 24 oz. total), peeled and cut lengthwise into even sized wedges , 5 tbsp. vegetable, canola or peanut oil, divided , Salt , Pepper', 'Preheat the oven to 475˚ F. \r\nPlace the potato wedges in a large mixing bowl. \r\nCover with hot water; soak for 10-30 minutes. Put 4 tablespoons of the oil onto a heavy, rimmed baking sheet. \r\nTilt the sheet side to side to evenly coat the pan with oil (a pastry brush can also help with this). \r\nSprinkle the pan evenly with the salt and pepper. \r\nSet aside.\r\nDrain the potatoes. \r\nSpread the wedges out on layers of paper towels or on clean kitchen towels. \r\nPat dry with additional towels. \r\nWipe out the now empty bowl so it is dry. \r\nReturn the potatoes to the bowl and toss with the remaining 1 tablespoon of oil.\r\nArrange the potato wedges on the prepared baking sheet in a single layer. \r\nCover tightly with foil and bake for 5 minutes. \r\nRemove the foil and continue to bake until the bottoms of the potatoes are spotty golden brown, 15-20 minutes, rotating the baking sheet after 10 minutes. \r\nUsing a metal spatula and tongs, flip each potato wedge keeping them in a single layer. \r\nContinue baking until the fries are golden and crisp, 5 -15 minutes. \r\nRotate the pan as needed to ensure even browning.\r\nWhen the fries are finished baking, transfer to a paper-towel lined plate to drain some of the grease. Season with additional salt and pepper to taste. \r\nServe warm.\r\n', 'https://lh3.googleusercontent.com/4OVqj4NnrpJIAiiVO7-QEjcanslAzN5Uk77gNy2GDBk2EIxeOCBUh5mQ4-dhwAsXAnyy90vXDYjmyRSt8tKon6993JJz1MaYUMc1uw8=w600', 0, ''),
(8, 'CHOCOLATE MILKSHAKE COCKTAIL', 'Orange or lime wedges , Coarse sugar , Unsweetened cocoa powder , 1 cup chocolate or chocolate chip ice cream , 1 1/3 cups chocolate milk , 1 teaspoon vanilla , 1/4 teaspoon peppermint extract or 2 drops almond extract (optional) , Chocolate curls , Maraschino cherries', 'Using 4 chilled martini glasses, rub the rims of martini glasses with a wedge of orange or lime. \r\nPlace sugar in a shallow dish; place cocoa powder in another shallow dish. \r\nInvert glasses and dip in sugar and then in cocoa powder to coat rims. \r\nDivide ice cream equally among martini glasses.\r\nIn a small pitcher combine chocolate milk, vanilla and, if you like, peppermint extract. \r\nPour over ice cream. \r\nTop with chocolate curls and cherries.', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRuXM8tC_p3WvVUTOY-HtaFboRKCCVCcjOBpamVKsEmzzT4Wk0A1EnpoEXm', 0, ''),
(9, 'CABBAGE FAT - BURNING SOUP', 'Cabbage , Onion , Salt , Tomato , Carrot , Green Beans , Pepper , Beef', 'Place carrots, onions, tomatoes, cabbage, green beans, pepper, and celery in a large pot. \r\n\r\nAdd onion soup mix, tomato juice, beef broth, and enough water to cover vegetables. \r\n\r\nSimmer until vegetables are tender', 'https://c.recipeland.com/images/r/16401/05906932b5af0ce70823_1024.jpg', 2, '');
INSERT INTO `receipe` (`r_id`, `r_name`, `ing`, `STEPS`, `imagesrc`, `res_id`, `image`) VALUES
(10, 'VEG HAKKA NODDLES', 'Noodles , Salt , Ginger , Sauce , Onion , Oil', 'Put noodles in 4 cups of salted boiling water. ...\r\nDrain and dry.\r\nHeat oil in wok or frypan until smoking hot.\r\nAdd ginger and onion stir for 30 seconds.\r\nAdd noodles and fry for 5 minutes over med heat.\r\nAdd sauce, and stir until coated.\r\nServe hot or cold.', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQe96HswWnz09ur3z0ksW6vzCL41SEISZxxcFXI7uc2huOuFyVmj6K3oXb4', 0, );
INSERT INTO `receipe` (`r_id`, `r_name`, `ing`, `STEPS`, `imagesrc`, `res_id`, `image`) VALUES
(11, 'HOMEMADE WONTON WRAPS', '1 egg , 1/3 cup water , 2 cups all-purpose flour , 1/2 teaspoon salt\r\n', 'In a medium bowl, beat the egg. \r\nMix in the water.\r\nIn a large bowl, combine the flour and salt. \r\nCreate a well in the center of the mixture and slowly pour in the egg and water. \r\nMix well. \r\nIf the mixture is too dry, increase the amount of water one teaspoon at a time until a pliable dough has formed.\r\nOn a lightly floured surface, knead the dough until elastic. \r\nCut dough into two separate balls. \r\nCover the balls with a damp cloth for a minimum of 10 minutes.\r\nCut each ball into four equal pieces. \r\nRoll the pieces into 10 1/2 by 10 1/2 inch squares. \r\nCut each into nine 3 1/2 by 3 1/2 inch squares. \r\nUse in any recipe that calls for wonton wrappers.', 'https://encrypted-tbn1.gstatic.com/images?q=tbn:ANd9GcRVbG2bSGKrBzfK-Vt3zxdr0kLxZ6hqYbm1wsduL_M0MQKWaIGtc01jBy8w', 0, );
INSERT INTO `receipe` (`r_id`, `r_name`, `ing`, `STEPS`, `imagesrc`, `res_id`, `image`) VALUES
(15, 'SPICY MAYO SPREAD', '1 cup mayonnaise , 4 chipotle peppers , 2 tablespoons adobo sauce\r\n', 'Remove 4 chilis from adobo sauce.\r\nFinely chop, add peppers to mayo. \r\nWhish or use a food processor to mix.\r\n', 'http://recipegreat.com/images/spicy-chipotle-chili-mayonnaise-01.jpg', 0, );
INSERT INTO `receipe` (`r_id`, `r_name`, `ing`, `STEPS`, `imagesrc`, `res_id`, `image`) VALUES
(16, 'HOMEMADE FRIES', '3-5 medium potatoes (with skin) , 2 tablespoons extra virgin olive oil , Seasonings\r\n', 'Preheat oven 350 degrees. \r\nWash potatoes. \r\nSlice into wedges (thickness is not important). \r\nAdd olive oil \r\nToss potatoes. \r\nAdd seasoning. \r\nToss potatoes. \r\nSpray parchment paper or cookie sheet with oil. \r\nPut potatoes on sheet. \r\nBake for 20 -30 minutes.\r\n', 'https://encrypted-tbn3.gstatic.com/images?q=tbn:ANd9GcRRriaimPzxKc45TGtM9jfjzUD8xMuw4xrD4LXUtQ5etHfWxRahZXlJ6yD3fQ', 0, );
INSERT INTO `receipe` (`r_id`, `r_name`, `ing`, `STEPS`, `imagesrc`, `res_id`, `image`) VALUES
(19, 'MINI GERMAN PANCAKES', '1 cup milk , 6 eggs , 1 cup flour , 1/2 tsp. salt , 1 tsp. vanilla , 1/4 cup butter, melted', 'Preheat oven to 400 degrees F. \r\nBlend first five ingredients (milk thru vanilla) in a blender.  \r\nBe careful to see that any flour clumps get well-blended.\r\nBlend in butter a little at a time in order to temper the eggs.\r\nGrease muffin tins well and distribute batter evenly between 24 tins  Bake for 15 minutes, or until puffy and golden on top.', 'https://barefeetinthekitchen.com/wp-content/uploads/2016/04/Mini-German-Pancakes-10-500x457.jpg', 0, );
INSERT INTO `receipe` (`r_id`, `r_name`, `ing`, `STEPS`, `imagesrc`, `res_id`, `image`) VALUES
(20, 'GARLIC CROUTONS', '4 tablespoons butter , 1 clove garlic, minced , 3 (3/4 inch thick) slices French bread, cut into cubes\r\n', 'Preheat oven to 350 degrees F (175 degrees C). \r\nIn a large saute pan, melt butter over medium heat. \r\nStir in garlic; cook and stir for 1 minute. \r\nAdd bread cubes, and toss to coat. \r\nSpread on a baking sheet. \r\nBake for 15 minutes, or until crisp and dry. Check frequently to prevent burning. \r\nCool.\r\n', 'http://images.media-allrecipes.com/userphotos/560x315/28481.jpg', 0, );
INSERT INTO `receipe` (`r_id`, `r_name`, `ing`, `STEPS`, `imagesrc`, `res_id`, `image`) VALUES
(21, 'RUSSIAN APPLE PIE', '4 large granny smith apples, peeled , 1/2 cup sugar , 1 cup flour , 3 large eggs\r\n', 'Remove core from the apples, cut in large chunks 2\",lay parchment paper on the bottom of your baking form.\r\nLay the apples on top of parchment paper.\r\nLet eggs warm up for 10 minutes,then mix till light yellow and foamy; add sugar in, small portions at a time, let sugar dissolve; add flour; mix till you see air bubbles, pour mixture on the apples.\r\nIt will soak throughout, do not mix apples with batter.\r\nBake for 55 minutes on 375Â°F.\r\nWhen pie is done flip upside down, Apples will be on the top.\r\n', 'https://encrypted-tbn2.gstatic.com/images?q=tbn:ANd9GcTE59mwb8J0qLa8l9mSP7OhR4oFdDIS-1g-a2Bjayn21CaT1uznjAWCTgfz', 0, );
INSERT INTO `receipe` (`r_id`, `r_name`, `ing`, `STEPS`, `imagesrc`, `res_id`, `image`) VALUES
(22, 'Banana Milkshake', 'MILK,BANANA,HONEY', 'Take a ripe banana. Peel and cut it into slices. ...\r\nAdd sliced banana in the jar of a blender or the large jar of a mixer grinder jar.\r\nAdd a pinch of cardamom powder. ...\r\nAdd 1-teaspoon sugar.\r\nAdd 2-scoops vanilla ice-cream.\r\nPour 3/4 cup milk over it.\r\nBlend until mixture turns smooth.', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQruN0PWPWwVPiEHG1UYHlAUSeU5OAJeqOInoDHleMg&s', 0, ''),
(23, 'Omlete', 'SALT,ONION,OIL', 'Break the eggs into a bowl\r\nBeat the eggs until the white and the yellow mix well\r\nAdd onions, chilies, and salt to the required amounts\r\nPour some oil into the pan\r\nPour the mix into the pan and cook for around 4-5 minutes.\r\nOnce cooked remove the omelet from the pan.\r\n', 'https://images.immediate.co.uk/production/volatile/sites/30/2020/08/omelette-3cba9f8.jpg', 0, '');

